INSERT INTO `movie` VALUES ('1', '正义联盟', '扎克·施奈德', '亨利·卡维尔,本·阿弗莱克,盖尔·加朵,杰森·莫玛,埃兹拉·米勒,雷·费舍', '动作,冒险,奇幻', '英语', '120', '受到超人无私奉献的影响，蝙蝠侠重燃了对人类的信心，接受了新盟友——神奇女侠的帮助，去对抗更加强大的敌人。蝙蝠侠和神奇女侠一同寻找并招募了一支超人类联盟来抵挡新觉醒的威胁。但尽管这支队伍集结了超人、蝙蝠侠、神奇女侠、闪电侠、海王和钢骨等人 ，他们似乎无法阻止敌人对地球的进攻……', '28.00', , '2017-12-01 12:12:00');
INSERT INTO `movie` VALUES ('2', '寻梦环游记', '李·昂克里奇', '本杰明·布拉特,盖尔·加西亚·贝纳尔,芮妮·维克托', '动作,动画,冒险', '英语', '105', '小男孩米格(安东尼·冈萨雷斯 配音)一心梦想成为音乐家，更希望自己能和偶像歌神德拉库斯(本杰明·布拉特 配音)一样，创造出打动人心的音乐，但他的家族却世代禁止族人接触音乐。米格痴迷音乐，无比渴望证明自己的音乐才能，却因为一系列怪事，来到了五彩斑斓又光怪陆离的神秘世界。在那里，米格遇见了魅力十足的落魄乐手埃克托(盖尔·加西亚·贝纳尔 配音)，他们一起踏上了探寻米格家族不为人知往事的奇妙之旅，并开启了一段震撼心灵、感动非凡、永生难忘的旅程。', '30.00', , '2017-12-08 15:42:52');
INSERT INTO `movie` VALUES ('3', '芳华', '冯小刚', '黄轩,苗苗,钟楚曦,杨采钰,李晓峰', '剧情,战争,爱情', '汉语普通话', '136', '根据严歌苓同名小说改编，讲述了上世纪七十到八十年代充满理想和激情的军队文工团，一群正值芳华的青春少年，经历着成长中的爱情萌发与充斥变数的人生命运。乐于助人、质朴善良的刘峰（黄轩饰），和从农村来，屡遭文工团女兵歧视与排斥的何小萍（苗苗饰），“意外”离开了浪漫安逸的文工团，卷入了残酷的战争，在战场上继续绽放着血染的芳华。他们感受着集体生活的痛与暖、故人的分别与重逢，还有时代变革之下，每个人的渺小脆弱和无力招架。而昔日的文工团战友萧穗子（钟楚曦饰）、林丁丁（杨采钰饰）、郝淑雯（李晓峰饰）、陈灿（王天辰饰）等人，', '38.00', , '2018-01-01 15:08:25');
INSERT INTO `movie` VALUES ('4', '奇门遁甲', '袁和平', '大鹏,倪妮,李治廷,周冬雨,伍佰,柳岩', '奇幻,动作', '汉语普通话', '113', '该片讲述的是一个妖孽横行，天象大乱的时代，外星妖物侵袭而来。此时江湖上精通“奇门遁甲”之术的神秘组织“雾隐门”挺身而出，其首领老大（伍佰 饰）、弟子诸葛青云（大鹏 饰）、铁蜻蜓（倪妮 饰）和雾隐七子等众人各怀所长。另一方面，诸葛青云途中寻找新一代掌门小圆（周冬雨 饰）之时，新晋捕快刀宜长（李治廷 饰）为救铁蜻蜓亦被牵连在内。一时间，风云涌起，“天外来客”与“雾隐门”之间的正邪之战即将引发，一场新的奇幻危机正在来临……', '38.00', , '2018-01-02 15:10:41');
INSERT INTO `movie` VALUES ('5', '妖猫传', '陈凯歌', '黄轩,染谷将太,张雨绮,秦昊', '史诗,奇幻,爱情', '汉语普通话', '129', '电影《妖猫传》讲述了盛唐时期一段奇幻的凄美史诗。癫狂诗人白乐天与仰慕大唐风采的僧人空海相遇长安，却意外触发了横跨三十年、有关王朝兴衰的惊天之秘，随着各色人物一一登场、大唐繁盛绚烂与时代隐痛一一揭开，一个被历史纷乱掩盖的真相也将浮出水面。', '41.00', , '2018-01-11 15:11:41');
INSERT INTO `movie` VALUES ('6', '机器之血', '张立嘉', '成龙,罗志祥,欧阳娜娜', '动作,喜剧', '汉语普通话', '110', '2007年，Dr.James在半岛军火商的支持下研究生化人。研究过程中，生化人安德烈发生基因突变大开杀戒，将半岛军火商杀害，并控制其组织，接管生化人的研究。Dr.James侥幸逃生，只好寻求警方的保护。特工林东（成龙 饰）不得以离开生命垂危的小女儿西西，接受证人保护任务... 十三年后，一本科幻小说《机器之血》的出版引出了黑衣生化人组织，神秘骇客李森（罗志祥 饰）（被杀害的半岛军火商的儿子），以及隐姓埋名的林东，三股力量都开始接近一个“普通”女孩Nancy（欧阳娜娜饰）的生活，想要得到她身上的秘密。而黑衣人幕后受伤隐藏多年的安德烈也再次出手，在多次缠斗之后终于抓走Nancy。林东和李森，不得不以身犯险一同前去解救，关键时刻却发现李森竟然是被杀害的半岛军火商的儿子，生化人的实验记录也落入了李森之手......', '40.00', , '2017-12-30 15:13:25');
INSERT INTO `movie` VALUES ('7', '心理罪之城市之光', '徐纪周', '邓超,阮经天,刘诗诗,林嘉欣', '犯罪,动作', '汉语普通话', '124', '一起连环凶杀案掀起了城市的狂欢与躁动，数起案件中受害者均遭虐待致死，且充满仪式感，所有线索都与一个人有关——精通犯罪心理学的天才神探方木（邓超饰）。在与同事米楠（刘诗诗饰）调查案件时，方木发现曾经是自己高中同学的江亚（阮经天饰）似乎深藏很多秘密。此时网络上出现名为“城市之光”的用户，以发起投票的方式让大众决定律师任川（郭京飞饰）的生死，方木、米楠等警察虽然用尽一切办法，依然无法阻止这场“以暴制暴”的黑暗审判，这座城市陷入了混乱的旋涡。紧要关头，方木觉察到江亚的妻子魏巍（林嘉欣饰）竟然是解锁江亚秘密的重要证人，就在真相即将大白的关键时刻，一场惊人变故突如其来.....', '44.00', , '2018-01-26 15:16:18');
